{
  "schemaVersion" : "1.0",
  "description" : "My Example CloudFormation Document",
  "templateBody" : {
    "AWSTemplateFormatVersion" : "2010-09-09",
    "Parameters" : {
      "QueueName" : {
        "Default" : "lwdkQueue",
        "Description" : "Name of SQS Queue",
        "Type" : "String"
      },
      "SecretParameter" : {
        "Default" : "secretParam",
        "Description" : "Name of parameter that is treated as sensitive parameter in LWDK flow",
        "Type" : "String",
        "NoEcho" : "true"
      }
    },
    "Resources" : {
      "testQueue" : {
        "Type" : "AWS::SQS::Queue",
        "Properties" : {
          "QueueName" : "QueueName"
        }
      }
    },
    "Outputs" : {
      "SecretParameterOutput" : {
        "Description" : "Output for the secret parameter to be used",
        "Value" : "SecretParameter"
      }
    }
  }
}
